<script>

 window.onload = function() {
      
    window.zoomTiger = svgPanZoom('#x', {
    zoomEnabled: true,
    controlIconsEnabled: true,
    fit: true,
    center: true,
    });
     
}; 
    
   
    d3.json("data/cijene.json", (data) => {
      window.cijene = data;
    })

      function crtajKosaricu(e) {
          var suma = 0;
          $("#completed").html("");
            if (e){
                for (var sjedalo of e.selection) {
                price = cijene[sjedalo.id.toString()];
                console.log(sjedalo.id, price)
                list = "<li>"+sjedalo.id+": "+price+"kn "+"</li>";
                suma=Number(suma)+Number(price);
                $("#completed").append(list)
                }
        }
      
      $("#total").html('\nUkupno:'+ suma + 'kn');
      localStorage.setItem("storageName",suma);
}

d3sc.registerSelectionChangeListener(crtajKosaricu);


var kosarica = {};

function brisisve() {
   
    d3sc.deselectAll();

    crtajKosaricu();
   
    
}

$("#remove_li").click(function(){
     this.select([])
        
       })
  
</script>
